Diamond Foxxx - Serving Up Greek

Added: February 09, 2011

Size:  462 Mb

She might be a freak in the bed, but when it comes to the kitchen, Diamond literally turns up the heat! When football player Jordan drops by to pick up a treat for the team's bake sale, he gets more than just a little sugar! Just because Diamond burnt the cake doesn't mean that she can't serve up a mean helping of pie!

